        <SocialIcon link="" icon="fab fa-github fa-2x"/>
        <SocialIcon link="" icon="fab fa-linkedin-in fa-2x"/>
        <SocialIcon link="" icon="fab fa-facebook-f fa-2x"/>
        {/* <SocialIcon link="" icon="fab fa-github fa-2x"/> */}
